INSERT INTO `events` (`id`, `event_title`, `event_description`, `event_date`, `start_time`, `end_time`, `adult_supervision`) VALUES
(1, 'Colossus', '<p>The world’s first ten-loop roller coaster Experience TEN exhilarating inversions, including a vertical loop, cobra roll, double corkscrew and the UK’s only quadruple barrel roll! Colossus proudly stands amongst the top ten roller coasters with the most inversions, worldwide! At 98 ft in the air, the iconic steel track stands like the Colossus of Rhodes - a powerful wonder of the theme park world! Fly high and low through Thorpe Park’s Lost City, close enough to wave to visitors on the path, before you dive into an underground trench. Brace yourself: there are surprises hidden around every curved corner on Colossus!</p>', '2022-12-18', '14:00:00', '17:00:00', 'Y'),
(2, 'Nemesis Inferno', '<p>Burst through the fiery pit at the heart of a steaming volcano. Nemesis Inferno takes an iconic thrill ride and turns up the heat… With your legs hanging freely below you on this inverted coaster, try not to let your feet get burnt!</p>', '2022-12-19', '15:00:00', '19:00:00', 'Y'),
(3, 'Sweeney', '<p>This relaxing children\'s rollercoaster ride is in a train design, and is covered with beautiful circus-themed imagery. Kids love riding this train rollercoaster - climb aboard the carriage and ride around the train track!</p><p>You\'ll love the fun and entertainment that this children\'s fairground attraction offers. Kids love the design and appearance of our children\'s rollercoaster ride, the dips and hills, and the enjoyment they have travelling around on it. The funky circus train carriages are sure to attract the younger attendees at your event.</p><p>When you hire a fairground ride from Nationwide Amusements, you know you\'re with a company that does everything it can to make your event run perfectly. This train rollercoaster ride is maintained continually, with its mechanics and its visual appearance continually inspected so we can ensure it remains as good as new.</p><p>&nbsp;</p>', '2022-12-20', '14:30:00', '16:00:00', 'N'),
(4, 'Rumba Rapids', '<p>Enjoy a ride down the Island\'s rapid river!&nbsp;</p><p>Minimum of 1.1m, riders between 1.1m and 1.3m must be accompanied by an adult aged 16+. In addition, each boat must have an accompanying adult aged 18+.</p>', '2022-12-27', '13:00:00', '14:00:00', 'Y');

